import React from 'react';
import './Footer.css';
import svgPaths from '../imports/svg-nygi9lxjs1';
import imgLogo4 from 'figma:asset/e5dad6bae0662905552572585fbbaf176486bd11.png';
import imgImage1 from 'figma:asset/931aae9b946a9239a69f6ca7a83883f624fde0e0.png';
import { Link } from 'react-router-dom';

const Footer = () => {
  return (
    <footer className="footer">
      {/* Wave décorative */}
      <div className="footer-wave">
        <div className="footer-wave-svg">
          <svg fill="none" preserveAspectRatio="none" viewBox="0 0 1330 78">
            <g>
              <path d={svgPaths.p1a0f3740} fill="white" />
              <path d={svgPaths.p16f1bd10} fill="white" />
            </g>
          </svg>
        </div>
      </div>
      
      {/* Colonne 1 : Logo promo */}
      <div className="footer-logo">
        <img src={imgLogo4} alt="Trouve ton artisan" />
      </div>
      
      {/* Colonne 2 : Contact */}
      <div className="footer-contact">
        <h3>Contact</h3>
        <address>
          <a
            href="https://www.google.com/maps?q=101+cours+Charlemagne,+69269+LYON+CEDEX+02,+France"
            target="_blank"
            rel="noopener noreferrer"
          >
            101 cours Charlemagne<br />
            CS 20033<br />
            69269 LYON CEDEX 02<br />
            France
          </a>
          <br />
          <a href="tel:+33426734000">+33 (0)4 26 73 40 00</a>
        </address>
      </div>
      
      {/* Colonne 3 : Pages légales */}
      <div className="footer-legal">
        <h3>Pages Légales</h3>
        <ul>
          <li><Link to="/mentions-legales">Mentions légales</Link></li>
          <li><Link to="/donnees-personnelles">Données personnelles</Link></li>
          <li><Link to="/accessibilite">Accessibilité</Link></li>
          <li><Link to="/cookies">Cookies</Link></li>
        </ul>
      </div>
      
      {/* Colonne 4 : Image région */}
      <div className="footer-image">
        <img src={imgImage1} alt="Logo Région Auvergne-Rhône-Alpes" />
      </div>
    </footer>
  );
};

export default Footer;
